get:
  # security:
  #   - Bearer: []
  tags:
    - group
  summary: "タイプスピードランキング取得"
  description: "グループのタイプスピードランキングを取得"
  parameters:
    - name: "groupId"
      in: query
      description: "グループID"
      required: true
      type: number
      example: 1
    - name: "start"
      in: query
      description: "検索範囲下限時刻"
      type: number
      example: 1630385077
    - name: "end"
      in: query
      description: "検索範囲上限時刻"
      type: number
      example: 1630390000
  responses:
    200:
      content:
        application/json:
          schema:
            $ref: "#/components/schemas/SpeedRank"
    400:
      $ref: "#/components/responses/400"
    401:
      $ref: "#/components/responses/401"
    500:
      $ref: "#/components/responses/500"